= 'pending'\n    AND expires_at > now();\n\n    -- 招待が見つからない場合\n    IF v_invitation.id IS NULL THEN\n        RAISE EXCEPTION '有効な招待が見つかりません';\n    END IF;\n\n    -- 共有リンクの場合、使用回数制限をチェック\n    IF v_invitation.invitation_type = 'share' AND v_invitation.max_uses IS NOT NULL THEN\n        IF v_invitation.used_count >= v_invitation.max_uses THEN\n            RAISE EXCEPTION '招待リンクの使用回数制限に達しました';\n        END IF;\n    END IF;\n\n    -- メンバーとして追加\n    INSERT INTO kouden_members (\n        kouden_id,\n        user_id,\n        role_id,\n        added_by,\n        invitation_id\n    ) VALUES (\n        v_invitation.kouden_id,\n        p_user_id,\n        v_invitation.role_id,\n        v_invitation.created_by,\n        v_invitation.id\n    );\n\n    -- 招待のステータスを更新\n    UPDATE kouden_invitations\n    SET status = 'accepted',\n        updated_at = now()\n    WHERE id = v_invitation.id;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.add_kouden_owner()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    editor_role_id UUID;\nBEGIN\n    -- 編集者ロールのIDを取得\n    SELECT id INTO editor_role_id\n    FROM kouden_roles\n    WHERE kouden_id = NEW.id\n    AND name = '編集者'\n    LIMIT 1;\n\n    -- 香典帳のオーナーをメンバーとして追加\n    INSERT INTO kouden_members (\n        kouden_id,\n        user_id,\n        role_id,\n        added_by\n    ) VALUES (\n        NEW.id,\n        NEW.owner_id,\n        editor_role_id,\n        NEW.created_by\n    );\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.cleanup_expired_locks()\n RETURNS void\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    DELETE FROM kouden_entry_locks\n    WHERE expires_at < NOW();\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.cleanup_kouden_related_data()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    -- 関連する招待情報の削除\n    DELETE FROM kouden_invitations WHERE kouden_id = OLD.id;\n    \n    -- 関連するメンバー情報の削除\n    DELETE FROM kouden_members WHERE kouden_id = OLD.id;\n    \n    -- 関連するロール情報の削除\n    DELETE FROM kouden_roles WHERE kouden_id = OLD.id;\n    \n    RETURN OLD;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.create_admin_audit_log(p_action character varying, p_target_type character varying, p_target_id uuid, p_details jsonb DEFAULT NULL::jsonb, p_ip_address inet DEFAULT NULL::inet)\n RETURNS uuid\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nDECLARE\n    v_admin_id UUID;\n    v_log_id UUID;\nBEGIN\n    -- Get the current user's ID\n    v_admin_id := auth.uid();\n    \n    -- Check if the user is an admin\n    IF NOT is_admin(v_admin_id) THEN\n        RAISE EXCEPTION 'User is not an admin';\n    END IF;\n\n    -- Insert the audit log\n    INSERT INTO admin_audit_logs (\n        admin_id,\n        action,\n        target_type,\n        target_id,\n        details,\n        ip_address\n    ) VALUES (\n        v_admin_id,\n        p_action,\n        p_target_type,\n        p_target_id,\n        p_details,\n        p_ip_address\n    ) RETURNING id INTO v_log_id;\n\n    RETURN v_log_id;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.create_default_kouden_roles()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    -- 編集者ロールの作成\n    INSERT INTO kouden_roles (kouden_id, name, description, permissions, created_by)\n    VALUES (\n        NEW.id,\n        '編集者',\n        '香典帳の内容を編集できます',\n        ARRAY['view', 'edit']::TEXT[],\n        NEW.created_by\n    );\n\n    -- 閲覧者ロールの作成\n    INSERT INTO kouden_roles (kouden_id, name, description, permissions, created_by)\n    VALUES (\n        NEW.id,\n        '閲覧者',\n        '香典帳の内容を閲覧できます',\n        ARRAY['view']::TEXT[],\n        NEW.created_by\n    );\n\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.create_invitation(p_kouden_id uuid, p_email text, p_role_id uuid, p_created_by uuid, p_type invitation_type DEFAULT 'email'::invitation_type, p_max_uses integer DEFAULT NULL::integer)\n RETURNS uuid\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nDECLARE\n    v_invitation_id UUID;\n    v_invitation_token UUID;\n    v_expires_at TIMESTAMP WITH TIME ZONE;\nBEGIN\n    -- 有効期限を24時間後に設定\n    v_expires_at := NOW() + INTERVAL '24 hours';\n    \n    -- 新しいトークンを生成\n    v_invitation_token := gen_random_uuid();\n    \n    -- メールタイプの場合、既存の有効な招待をチェック\n    IF p_type = 'email' AND p_email IS NOT NULL THEN\n        IF EXISTS (\n            SELECT 1 FROM kouden_invitations\n            WHERE kouden_id = p_kouden_id\n            AND email = p_email\n            AND status = 'pending'\n            AND expires_at > NOW()\n        ) THEN\n            RAISE EXCEPTION 'すでに有効な招待が存在します';\n        END IF;\n    END IF;\n\n    -- 招待を作成\n    INSERT INTO kouden_invitations (\n        kouden_id,\n        email,\n        role_id,\n        invitation_token,\n        status,\n        expires_at,\n        created_by,\n        invitation_type,\n        max_uses\n    ) VALUES (\n        p_kouden_id,\n        p_email,\n        p_role_id,\n        v_invitation_token,\n        'pending',\n        v_expires_at,\n        p_created_by,\n        p_type,\n        p_max_uses\n    )\n    RETURNING id INTO v_invitation_id;\n\n    RETURN v_invitation_id;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.generate_invitation_token()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    IF NEW.invitation_token IS NULL THEN\n        NEW.invitation_token := encode(gen_random_bytes(32), 'hex');\n    END IF;\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.handle_new_user()\n RETURNS trigger\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nBEGIN\n    INSERT INTO public.profiles (id, display_name)\n    VALUES (NEW.id, COALESCE(NEW.raw_user_meta_data->>'name', NEW.email));\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.increment_invitation_used_count()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    -- 招待IDがある場合のみカウントを更新\n    IF NEW.invitation_id IS NOT NULL THEN\n        UPDATE kouden_invitations\n        SET used_count = used_count + 1\n        WHERE id = NEW.invitation_id;\n    END IF;\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.initialize_default_relationships()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    -- デフォルトの関係性を追加\n    INSERT INTO relationships (\n        kouden_id,\n        name,\n        description,\n        is_default,\n        created_by\n    ) VALUES\n    (NEW.id, '親族', '故人の親族', true, NEW.created_by),\n    (NEW.id, '友人', '故人の友人', true, NEW.created_by),\n    (NEW.id, '知人', '故人の知人', true, NEW.created_by),\n    (NEW.id, '会社関係', '故人の会社関係者', true, NEW.created_by),\n    (NEW.id, '近所', '故人の近所の方', true, NEW.created_by),\n    (NEW.id, 'その他', 'その他の関係', true, NEW.created_by);\n\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.initialize_default_relationships(kouden_id uuid, owner_id uuid)\n RETURNS void\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\nBEGIN\n    -- デフォルトの関係性を挿入\n    INSERT INTO relationships (kouden_id, name, description, is_default, created_by)\n    VALUES\n        (kouden_id, '仕事関係', '職場の同僚や取引先など', TRUE, owner_id),\n        (kouden_id, '友人', '友人や知人など', TRUE, owner_id),\n        (kouden_id, '親族', '親族や家族など', TRUE, owner_id),\n        (kouden_id, 'その他', 'その他の関係', TRUE, owner_id)\n    ON CONFLICT (kouden_id, name) DO NOTHING;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.is_admin(user_uid uuid)\n RETURNS boolean\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nBEGIN\n    RETURN EXISTS (\n        SELECT 1 \n        FROM admin_users \n        WHERE user_id = user_uid\n    );\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.log_debug(p_action text, p_details jsonb)\n RETURNS uuid\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nDECLARE\n    v_log_id UUID;\nBEGIN\n    INSERT INTO debug_logs (action, user_id, details)\n    VALUES (p_action, auth.uid(), p_details)\n    RETURNING id INTO v_log_id;\n    \n    RETURN v_log_id;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.log_kouden_entry_changes()\n RETURNS trigger\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\nDECLARE\n    current_user_id UUID;\nBEGIN\n    -- 現在のユーザーIDを取得（トリガー内でauth.uid()が動作しない場合の対策）\n    current_user_id := auth.uid();\n    \n    IF TG_OP = 'INSERT' THEN\n        INSERT INTO kouden_entry_audit_logs (entry_id, user_id, action, changes)\n        VALUES (NEW.id, COALESCE(current_user_id, NEW.created_by), 'create', to_jsonb(NEW));\n    ELSIF TG_OP = 'UPDATE' THEN\n        INSERT INTO kouden_entry_audit_logs (entry_id, user_id, action, changes)\n        VALUES (NEW.id, COALESCE(current_user_id, NEW.last_modified_by), 'update', jsonb_build_object(\n            'old', to_jsonb(OLD),\n            'new', to_jsonb(NEW)\n        ));\n    ELSIF TG_OP = 'DELETE' THEN\n        INSERT INTO kouden_entry_audit_logs (entry_id, user_id, action, changes)\n        VALUES (OLD.id, COALESCE(current_user_id, OLD.created_by), 'delete', to_jsonb(OLD));\n    END IF;\n    RETURN CASE WHEN TG_OP = 'DELETE' THEN OLD ELSE NEW END;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.remove_member(p_kouden_id uuid, p_user_id uuid)\n RETURNS void\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nBEGIN\n    -- メンバーの存在確認\n    IF NOT EXISTS (\n        SELECT 1 FROM kouden_members\n        WHERE kouden_id = p_kouden_id\n        AND user_id = p_user_id\n    ) THEN\n        RAISE EXCEPTION 'メンバーが見つかりません';\n    END IF;\n\n    -- メンバーを削除\n    DELETE FROM kouden_members\n    WHERE kouden_id = p_kouden_id\n    AND user_id = p_user_id;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.set_invitation_token(token uuid)\n RETURNS void\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\nBEGIN\n    -- 招待の有効性を確認\n    IF NOT EXISTS (\n        SELECT 1 \n        FROM kouden_invitations \n        WHERE invitation_token = token\n        AND status = 'pending'\n        AND expires_at > now()\n        AND (max_uses IS NULL OR used_count < max_uses)\n    ) THEN\n        RAISE EXCEPTION '無効な招待トークンです';\n    END IF;\n\n    -- セッション設定に招待トークンを設定\n    PERFORM set_config('app.current_invitation_token', token::text, true);\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.set_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = CURRENT_TIMESTAMP;\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.trigger_set_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = now();\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_admin_users_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_kouden_entry_locks_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_kouden_entry_modified()\n RETURNS trigger\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nBEGIN\n    NEW.version = OLD.version + 1;\n    NEW.last_modified_at = NOW();\n    NEW.last_modified_by = auth.uid();\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_member_role(p_kouden_id uuid, p_user_id uuid, p_role_id uuid)\n RETURNS void\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nBEGIN\n    -- メンバーの存在確認\n    IF NOT EXISTS (\n        SELECT 1 FROM kouden_members\n        WHERE kouden_id = p_kouden_id\n        AND user_id = p_user_id\n    ) THEN\n        RAISE EXCEPTION 'メンバーが見つかりません';\n    END IF;\n\n    -- ロールの存在確認\n    IF NOT EXISTS (\n        SELECT 1 FROM kouden_roles\n        WHERE id = p_role_id\n        AND kouden_id = p_kouden_id\n    ) THEN\n        RAISE EXCEPTION 'ロールが見つかりません';\n    END IF;\n\n    -- ロールを更新\n    UPDATE kouden_members\n    SET role_id = p_role_id,\n        updated_at = now()\n    WHERE kouden_id = p_kouden_id\n    AND user_id = p_user_id;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_support_ticket_comments_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_support_tickets_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_system_announcements_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nbegin\n  new.updated_at = current_timestamp;\n  return new;\nend;\n$function$","CREATE OR REPLACE FUNCTION public.update_updated_at_column()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = TIMEZONE('utc'::text, NOW());\n    RETURN NEW;\nEND;\n$function$","grant delete on table \\"public\\".\\"admin_audit_logs\\" to \\"anon\\"","grant insert on table \\"public\\".\\"admin_audit_logs\\" to \\"anon\\"","grant references on table \\"public\\".\\"admin_audit_logs\\" to \\"anon\\"","grant select on table \\"public\\".\\"admin_audit_logs\\" to \\"anon\\"","grant trigger on table \\"public\\".\\"admin_audit_logs\\" to \\"anon\\"","grant truncate on table \\"public\\".\\"admin_audit_logs\\" to \\"anon\\"","grant update on table \\"public\\".\\"admin_audit_logs\\" to \\"anon\\"","grant delete on table \\"public\\".\\"admin_audit_logs\\" to \\"authenticated\\"","grant insert on table \\"public\\".\\"admin_audit_logs\\" to \\"authenticated\\"","grant references on table \\"public\\".\\"admin_audit_logs\\" to \\"authenticated\\"","grant select on table \\"public\\".\\"admin_audit_logs\\" to \\"authenticated\\"","grant trigger on table \\"public\\".\\"adm